import React from "react";
import styles from "Rooms.module.css";

const Rooms = () => {
  return (
    <>
      <div className="container">
        <div className={styles.roomsHeader}>
          <div className={styles.left}></div>
          <div className={styles.right}></div>
        </div>
      </div>
    </>
  );
};

export default Rooms;
